(1856, 'Ozone Three Step Aluminium Roller Shutter, AL, 900X1500 mm', 'Hardware', 'Rolling Shutters', 'Ozone', 29000.00, 20000.00, 'https://www.ozonehardware.com/ProductImage/1959/Large', 'OE-RS-M-900x1500 AN', 'Introducing the Ozone Three Step Aluminium Roller Shutter, AL, 900X1500 mm - the perfect addition to your kitchen or wardrobe! Made with a satin stainless steel finish, this shutter is both stylish and durable. With cabinet sizes of (W)900mm and (H)1500mm, it is suitable for a variety of carcass sizes. The 25mm profile and minimum 300mm cabinet depth make it easy to install. Weighing in at only 14 kgs for the box system and 1.8 kgs for the side profile, this shutter is lightweight and easy to handle. Order now and experience the convenience of the Ozone Three Step Aluminium Roller Shutter', 15, NULL, 'OZNERLNGSHTRAL900X1500MM', 0, NULL),
