(1859, 'Ozone Triple Adjustable Concealed Hinge 40L', 'Hardware', 'Hinges & Channels', 'Ozone', 10000.00, 8500.00, 'https://www.ozone-india.com/ProductImage/3139/Large', 'DCSPA1012OOPL', 'The Ozone Triple Adjustable Concealed Hinge is a 3D adjustable hinge that offers flexibility for left and right opening doors. With a maximum door weight of 60kg using two hinges, it can support doors up to 40kg. This hinge is suitable for doors with a minimum thickness of 40mm and a maximum width of 1000mm. It has a satin/nickel finish and is supplied with stainless steel screws for easy installation. Upgrade your doors with this reliable and durable hinge.', 0, NULL, 'OZNHNGTRPL40L', 0, NULL),
