(1955, 'LivSmartKitchen Drawer Rack – Plate', 'Hardware', 'Drawers & Pullouts', 'Livsmart', 1050.00, 800.00, 'https://d23erx3tjj9jvc.cloudfront.net/api/products/1b498550-b0df-4f72-b673-e21cde5c6f17.jpeg-lg', 'KDR 18P', 'Introducing the LivSmartKitchen Drawer Rack - Plate, the perfect solution for keeping your plates organized and easily accessible. This portable kitchen plate rack can be positioned inside drawers, cabinets, or on the kitchen countertop, making it a versatile addition to your kitchen. Made of SS304 grade and electro polished, it is safer for kitchen use unlike chrome plating. Designed for convenience, it has a handle grip that makes it comfortable to carry, and a PVC coating that protects plates from scratches. The rubber bush also prevents the plates from slipping or sliding around. Upgrade your kitchen organization with this must-have plate rack.', 5, NULL, 'LVSMRTRCKPLT', 0, NULL),
(1956, 'LivSmart Kitchen Drawer Rack – Thali', 'Hardware', 'Drawers & Pullouts', 'Livsmart', 1290.00, 1000.00, 'https://ebco.in/image/cache/catalog/kitchen_drawer_rack_thali/Kitchen%20Drawer%20Rack%20-%20Thali_Main%20Image-550x550w.jpg', 'KDR-18T', 'The LivSmart Kitchen Drawer Rack - Thali is a versatile and portable solution for organizing your kitchenware. Made of high-quality SS304 grade steel, it is electro polished for added safety in the kitchen. With a convenient handle grip, you can easily carry it around wherever you go. This thali rack can be positioned inside drawers, cabinets, or on the kitchen countertop for easy access. The PVC coating protects thalis from scratches while the rubber bush prevents slipping. Get your LivSmart Kitchen Drawer Rack - Thali today and enjoy a more organized and efficient kitchen', 10, NULL, 'LVSMRTRCKTHLI', 0, NULL);
