(1957, 'WorkSmart Safe Drawer Mini - Top Mount Double with Felt Mat', 'Hardware', 'Drawers & Pullouts', 'WorkSmart', 3008.00, 2000.00, 'https://ebco.in/image/cache/catalog/safe-drawer-mini-top-mount-double/20032024/dp-img-1-1000x1000.png', 'SMD-DM1        ', 'The WorkSmart Safe Drawer Mini - Top Mount Double with Felt Mat is the perfect solution for your storage needs. With the option of locking systems including cam lock, combination lock and Touchpad combination lock, you can be sure that your belongings are safe and secure. This drawer is suitable for multipurpose applications at home, offices, retail stores, and more. The drawer dimensions of 350 X 270 X 120mm and a weight capacity of 20kgs make it a convenient and practical option. It is also System 32 compatible, making it easy to install in a variety of settings.', 10, NULL, 'WRKSMRTDRWRSNGL', 0, NULL),
(1958, 'WorkSmart Safe Drawer - Double (without Felt Mat)', 'Hardware', 'Drawers & Pullouts', 'WorkSmart', 3492.00, 2500.00, 'https://ebco.in/image/cache/catalog/Safe-Drawer-Double/20032024/dp-img-1-1000x1000.jpg', 'SD - TM1D', 'The WorkSmart Safe Drawer - Double is the perfect solution for your storage needs. With a top lockable drawer designed to accommodate a laptop and a bottom drawer for stationery items, this drawer is both convenient and practical. It can be used with regular as well as height adjustable desks (Smart Lifts) due to its versatile design. The safety mounting brackets ensure that the drawer cannot be removed as long as it is in the locked position, providing added security. This drawer is suitable for laptops with a maximum size of 390 x 270 x 40mm and has storage upto 30 kg', 10, NULL, 'WRKSMRTDRWRDBLNOMAT', 0, NULL),
(1959, 'WorkSmart Safe Drawer - Double (with Felt Mat)', 'Hardware', 'Drawers & Pullouts', 'WorkSmart', 3768.00, 2500.00, 'https://ebco.in/image/cache/catalog/Safe-Drawer-Double/20032024/dp-img-1-1000x1000.jpg', 'SDM - TM1D', 'The WorkSmart Safe Drawer - Double is the perfect solution for your storage needs. With a top lockable drawer designed to accommodate a laptop and a bottom drawer for stationery items, this drawer is both convenient and practical. It can be used with regular as well as height adjustable desks (Smart Lifts) due to its versatile design. The safety mounting brackets ensure that the drawer cannot be removed as long as it is in the locked position, providing added security. This drawer is suitable for laptops with a maximum size of 390 x 270 x 40mm and has storage upto 30 kg', 10, NULL, 'WRKSMRTSFEDRWRDBLMT', 0, NULL),
(1960, 'LivSmart Makeup Drawer Tray Set (308X422X90)', 'Hardware', 'Hardware Accessories', 'Livsmart', 3130.00, 1500.00, 'https://ebco.in/image/cache/catalog/makeup-drawer-tray-container/20231030/dp-img-1-550x550.jpg', 'MDT 45 AT', 'The LivSmart Makeup Drawer Container Tray is a must-have for any makeup enthusiast. This thoughtfully designed kit is perfect for organizing your makeup collection in your wardrobe or dressing unit. The tray features multiple grids, each equipped with a small tray, cosmetic holder, and small boxes with lids, making it ideal for storing brushes, eyeshadows, and other makeup accessories. The cosmetic holder is perfect for arranging lipsticks, eye-pencils, and nail lacquers, while the handy small box with a lid is perfect for organizing hair accessories. With this tray, you can keep your makeup collection neat, tidy, and easily accessible.', 12, NULL, 'LVSMRTDRWRMKUP2', 0, NULL),
(1961, 'LivSmart Pro Motion Drawer System ‘N’ Series (Silver Grey) – 185X500mm', 'Hardware', 'Drawers & Pullouts', 'Livsmart', 3724.00, 2700.00, 'https://ebco.in/image/cache/catalog/pro-motion-drawer-system-n-series/pro-motion-drawer-system-185mm-1000x1000.jpg', 'PMDS3-50-N', 'Introducing the LivSmart Pro Motion Drawer System ‘N’ Series in Silver Grey, with a length range of 500mm and side panel height of 185mm. The drawer width can be freely designed with automatic error adjustment, allowing for a customized fit in any space. With a load capacity of 65kg for 500mm length&nbsp;this drawer system is built to handle heavy items. The full extension of the drawer is equipped with a soft close feature for a smooth and quiet closing experience. The quick installation and dismantling process, combined with the facia panel system for internal drawers, make this drawer system a great choice for any project. Additionally, there is an option to add an add-on gallery to increase storage capacity.', 10, NULL, 'LVSMRTDRWRN185X50065KG', 0, NULL),
(1962, 'LivSmart Pro Motion Drawer System ‘N’ Series (Silver Grey) – 185X450mm', 'Hardware', 'Drawers & Pullouts', 'Livsmart', 3536.00, 2500.00, 'https://ebco.in/image/cache/catalog/pro-motion-drawer-system-n-series/pro-motion-drawer-system-185mm-1000x1000.jpg', 'PMDS3-45-N', 'Introducing the LivSmart Pro Motion Drawer System ‘N’ Series in Silver Grey, with a length range of 400mm and side panel height of 185mm. The drawer width can be freely designed with automatic error adjustment, allowing for a customized fit in any space. With a load capacity of 30kg for 400/450mm length&nbsp;this drawer system is built to handle heavy items. The full extension of the drawer is equipped with a soft close feature for a smooth and quiet closing experience. The quick installation and dismantling process, combined with the facia panel system for internal drawers, make this drawer system a great choice for any project. Additionally, there is an option to add an add-on gallery to increase storage capacity.', 10, NULL, 'LIVSMRTDRWRN185X45030KG', 0, NULL),
(1963, 'LivSmart Pro Motion Drawer System ‘N’ Series (Silver Grey) – 80 X 500 mm 65 kg', 'Hardware', 'Drawers & Pullouts', 'Livsmart', 3362.00, 2500.00, 'https://ebco.in/image/cache/catalog/pro-motion-drawer-system-n-series/20231106/pro-motion-drawer-system-80mm-1000x1000.jpg', 'PMDS1-50-N        ', 'Introducing the LivSmart Pro Motion Drawer System ‘N’ Series, available in a sleek silver grey color. Choose from four different lengths of 400, 450, 500, or 550mm, all with a side panel height of 80mm. You can freely design the drawer width with automatic error adjustment and it has a load capacity of&nbsp;65kg for 500/550mm length. The drawer also features a full extension with a soft close feature for easy, quiet use. Installation and dismantling are quick and easy, and the drawer system includes a facia panel system for internal drawers and an optional add-on gas spring for even smoother operation. Upgrade your drawer with the LivSmart Pro Motion Drawer System ‘N’ Series today.', 10, NULL, 'LVSMRTDRWRN80X500MM', 0, NULL),
(1964, 'LivSmart Pro Motion Drawer System ‘N’ Series (Silver Grey) – 80 X 450 mm & 30 kg', 'Hardware', 'Drawers & Pullouts', 'Livsmart', 2874.00, 2000.00, 'https://ebco.in/image/cache/catalog/pro-motion-drawer-system-n-series/20231106/pro-motion-drawer-system-80mm-1000x1000.jpg', 'PMDS1-45-N        ', 'Introducing the LivSmart Pro Motion Drawer System ‘N’ Series, available in a sleek silver grey color. Choose from four different lengths of 400, 450, 500, or 550mm, all with a side panel height of 80mm. You can freely design the drawer width with automatic error adjustment and it has a load capacity of 30kg for 400/450mm length and 65kg for 500/550mm length. The drawer also features a full extension with a soft close feature for easy, quiet use. Installation and dismantling are quick and easy, and the drawer system includes a facia panel system for internal drawers and an optional add-on gas spring for even smoother operation. Upgrade your drawer with the LivSmart Pro Motion Drawer System ‘N’ Series today.', 10, NULL, 'LVSMRTDRWRN80X450MM', 0, NULL),
(1965, 'Hettich Flap Stay Lift Basic', 'Hardware', 'Piston & Shocker', 'Hettich', 390.00, 250.00, 'https://www.hettichindiaonline.com/media/catalog/product/cache/1/image/450x350/81eac6ad5989871dad2d70c29756ad5c/9/0/9079593.jpg', '9079593', 'The Hettich Flap Stay Lift Basic is the perfect solution for those who seek both functionality and style in their kitchen. With a weight carrying capacity of 3.2Kg, this product is designed to last and withstand frequent use. Part of the elegant collection of Hardware Fittings products from Hettich, this premium product boasts unmatched quality and aesthetics. It\'s versatile and can be used in living rooms, bedrooms, offices, and other spaces where easy and convenient access is required. Upgrade your kitchen with the Hettich Flap Stay Lift Basic and enjoy its superior performance and sleek design.', 10, NULL, 'HTTCHFLPBSLFT', 0, NULL),
